import React from "react";
import '../css/bookSearch.css';

const Result = () =>{
    return(
        <section id="pickup">
        <div>
            <h2>検索結果</h2>
            <div id="pickupcontens">
                <ul>
                    <li>
                        <img src="..\image\noImage.png" alt="画像"/>
                        <h3 id="content-title">タイトルタイトル</h3>
                        <p>テキストテキストテキスト</p>
                    </li>
                    </ul>
            </div>
            </div>
    </section>
    );

};

export default Result;
